import React from 'react'

const Hello = (props) => {
    const bornYear = () =>{
        const yearNow = new Date().getFullYear()
        return yearNow - props.age
    }
    
    return (
        <div>
            <p>
                Hello {props.name}, your are {props.age} years old
            </p>
            <p>
                So you were probaly born in {bornYear()}
            </p>
        </div>
    )
}

const App = () =>{
    const name = 'Anna'
    const age = 36

    return (
        <div>
            <h1>Greetings</h1>
            <Hello name='Victor' age={30+20} />
            <Hello name={name} age={age} />
        </div>
    )
}

export default App;
